import Experience from "./Experience"

export default function ExperienceList( { heading } ) {

    const expList = [
        {
            position: "Technical Lead",
            company : "Kilowott Pvy Ltd, Porvorim",
            startdate : "2019",
            enddate: "",
            content: 'Lorem ipsum dolllar amet'
        },
        {
            position: "Front-End Developer",
            company : "Ajency.in, Panjim",
            startdate : "2015",
            enddate: "2019",
            content: 'Lorem ipsum dolllar amet'
        },
        {
            position: "Jr. Front-End Developer",
            company : "New visition Imaging, Mapusa",
            startdate : "2013",
            enddate: "2015",
            content: 'Lorem ipsum dolllar amet'
        },
    ]

    return (
        <div className="">
            <h2>{heading}</h2>
            <Experience expList={expList} />
        </div>
    )
}
